data.text:
@anareginafv @folha @BolsonaroSP Penso que o indivíduo que assassinou a moradora de rua, já se encontra preso.
Mas o que a matou foi o uso das drogas e a falta de um cuidado por parte dos últimos governantes no trato da proteção social.
Internação compulsória salva a vida do viciado e da coletividade.

@DAVILAFREDERICO Patriota aonde?
No Brasil que não é.
Muito menos no Chile, onde se torturou, matou e ainda por cima roubou em nome desse ser que nunca deveria sair do esgoto da História.

@Mechecabanillas Urgente. Que su familia haga algo por esta senil señora.
Acuérdense que dias previos a su eliminación, el suicida denunciaba súbitamente casos de anemia. (Olvidando que fue gobierno)
No vaya a ser que esta distinguida dama siga los pasos del cobarde que evadió a la justicia.

